import React, {useEffect, useState} from 'react';


function App() {

  const [str,setstr] = useState('');

  function buildStr(e){
    let newStr = str + e;
    setstr(newStr);
  }
  return (
    <div className="App">
      <div className="Buttons">
        <div className="row">


        </div>

      </div>
      <footer>Made by Cristian Reyes</footer>
    </div>
  );
}

export default App;
